import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './css/Home.css';
import './App.js'
import './result.js'
function Home() {

    const [peopleCount, setPeopleCount] = useState(1);

    const [takeUrl, setTakeUrl] = useState([<><input type="text" name="1" id='1'></input><br/></>]);

    const [html, setHtml] = useState('HTML');

    return <>

    <div class='App'>

        <h1>Bob 먹자 Go</h1>
<table class="tablebody" style="margin-top: -2px;">
<tbody>
<tr><th>
<div class="times">
<div class="time">오전 0시</div>
<div class="time">오전 1시</div>
<div class="time">오전 2시</div>
<div class="time">오전 3시</div>
